function GuzzlingYT() {

    var images = {
        curry: new Image(),
        ytOpen: new Image(),
        ytClose: new Image(),
        om: new Image(),
        nom: new Image()
    };

    var yt = {
        x: 0,
        y: 50,
        width: 300,
        height: 238,
        borderWidth: 20,
        mouthWidth: 100,
        sprite: new Image(),
        mouthOpened: false
    };

    var balloon = {
        duration: 90,
        x: 290,
        y: -50,
        closeX: 0
    };

    window.requestAnimFrame = (function () {
        return window.requestAnimationFrame ||
            window.webkitRequestAnimationFrame ||
            window.mozRequestAnimationFrame ||
            window.oRequestAnimationFrame ||
            window.msRequestAnimationFrame ||
            function (callback) {
                window.setTimeout(callback, 1000 / 60);
            };
    })();

    var that = this;

    var canvas;
    var context;

    var curries;
    var startTime = new Date().getTime();
    var speed = 300;
    var lastEaten;

    var b64YtOpen = "data:image/png;base64,";
    var b64YtClose = "data:image/png;base64,";
    var b64Curry = "data:image/png;base64,";
    var b64Om = "data:image/png;base64,";
    var b64Nom = "data:image/png;base64,";

    this.createImages = function () {
        images.curry.src = b64Curry;
        images.ytOpen.src = b64YtOpen;
        images.ytClose.src = b64YtClose;
        images.om.src = b64Om;
        images.nom.src = b64Nom;
    };

    this.generateCurries = function () {
        curries = [];
        var lastX = 0;
        var count = 0;

        while (lastX < canvas.width) {
            var diff = Math.floor(Math.random() * (400 - 150 + 1) + 150);
            var x = lastX + diff;

            if (count == 0) {
                curries.push({x: x, y: 160, eaten: false, balloonImg: images.om});
            } else {
                curries.push({x: x, y: 160, eaten: false, balloonImg: images.nom});
            }

            count++;
            lastX = x;
        }
    };

    this.createCanvas = function () {
        canvas = document.createElement("canvas");
        canvas.setAttribute("id", "guzzlingYtCanvas");
        canvas.setAttribute("width", "" + window.innerWidth);
        canvas.setAttribute("height", "" + "300");
        document.body.appendChild(canvas);

        context = canvas.getContext('2d')
    };

    this.omnomnom = function () {
        var time = (new Date()).getTime() - startTime;
        var newX = speed * time / 1000;
        var frontX = newX + yt.width + yt.borderWidth;
        var mouthEnd = newX + yt.width - yt.mouthWidth;

        context.clearRect(0, 0, canvas.width, canvas.height);

        if (newX < canvas.width - yt.width - yt.borderWidth / 2) {
            yt.x = newX;
        } else {
            return;
        }

        requestAnimFrame(function () {
            that.omnomnom();
        });

        var mouthOpenedBefore = yt.mouthOpened;
        yt.mouthOpened = false;

        for (var i = 0; i < curries.length; i++) {
            var curry = curries[i];

            if (curry.eaten) {
                continue;
            }

            if (frontX > curry.x && mouthEnd < curry.x) {
                yt.mouthOpened = true;
            }

            if (curry.x < mouthEnd) {
                curry.eaten = true;
                lastEaten = curry;
            }

            if (!curry.eaten) {
                context.drawImage(images.curry, curry.x, curry.y);
            }
        }

        if (yt.mouthOpened) {
            context.drawImage(images.ytOpen, yt.x, yt.y);
        } else {
            context.drawImage(images.ytClose, yt.x, yt.y);

            if (mouthOpenedBefore) {
                balloon.closeX = newX + balloon.duration;
            }
        }

        if (balloon.closeX > newX && lastEaten != null) {
            context.drawImage(lastEaten.balloonImg, yt.x + balloon.x, yt.y + balloon.y);
        }
    };

    this.createCanvas();
    this.generateCurries();
    this.createImages();
    this.omnomnom();
}

